import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Header from './components/Header'
import SearchBar from './components/SearchBar';
import { Modal } from 'bootstrap';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header/>
        <Modal/>
        <SearchBar/>
      </BrowserRouter>

      
    </div>
  );
}

export default App;
